script: |
  super -f text -I q1501.spq | sort > q1501.out

inputs:
  - name: q1501.spq
    data: |
      SELECT DISTINCT COUNT ( * ) AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - col2 IN ( - - 66, + col1 * - 95 - - col1 * - col2 + - col1 + col2 );
  - name: tab0

outputs:
  - name: q1501.out
    data: |
      3
